import React from "react";
import Header from "../components/Header";

const About = (props) => {
  return (
    <div className="header">
      <h1>About</h1>
      <div className="breadcrumb">
        <Header/>
      </div>
      <div className="page">Welcome to the Bookcase Application.</div>
    </div>
  );
};

export default About;
